import React from 'react'
import styled from 'styled-components';

import IG from '../Resources/IG.png';
import FB from '../Resources/FB.png'

const FooterWrapper = styled.div`
    min-height: 45vh;
    background-color: #f6f6f6;
    display: flex;
    flex-wrap: wrap;
    justify-content: center;
    align-items: center;
`;

const LinksWrapper = styled.div`
    display: flex;
    flex-flow: column wrap;
    // align-items: center;
    min-width: 40%;
`;

const FooterTitle = styled.p`
    font-weight: 600;
    color: black;
    margin-bottom: 5px;
`;

const FooterLink = styled.p`
    color: #424242;
    &:hover {
        opacity: 0.8;
    }
    margin-bottom: 5px;
`;

const SocialMedia = styled.img`
    height: 50px;
    width: auto;
    &:hover {
        opacity: 0.8;
    }
`;

function Footer() {
    return (
        <FooterWrapper>
            <LinksWrapper>
                <FooterTitle>Useful Links</FooterTitle>
                <FooterLink>Privacy Policy</FooterLink>
                <FooterLink style={{marginBottom: '35px'}}>Terms & Conditions</FooterLink>

                <FooterTitle>Social Media</FooterTitle>
                <SocialMedia></SocialMedia>
                <SocialMedia></SocialMedia>

                <FooterTitle>Copyright</FooterTitle>
                <FooterLink style={{marginBottom: '20px'}}>Abdurahman Hijazi Â© 2021</FooterLink>
            </LinksWrapper>
        </FooterWrapper>
    )
}

export default Footer;
